import React from 'react'
import {NavLink} from 'react-router-dom'


const Menu = () =>{
    return(
        <>
        <NavLink exact to="/" activeClassName = "active_class">About</NavLink>
        <NavLink exact to="/service" activeClassName = "active_class">Service</NavLink>
        </>
    )
}


export default Menu;
